import {Link} from 'react-router-dom'

function LinkButton(props){

    const {link, h1text, h2text} = props;

    return(
        <Link to = {link}>
            <h1>{h1text}</h1>
            <h2>{h2text}</h2>
        </Link>
    )
}

export default LinkButton
